      box-shadow: -10px -10px 50px rgba(0, 0, 0, 0.05);
      width: 100%;
      position: relative;
      z-index: 5;
    }
    &::after {
      content: '';
      display: block;
      position: absolute;
      z-index: 1;
      background: @lighter-blue;
      width: 34%;
      height: 117%;
      top: -9%;
      right: 0;
    }
  }
  @media @medium {
    margin-left: unset;
    .img-block {
      width: 60%;
      &::after {
        height: 110%;
        top: -6%;
      }
    }
  }
  @media @tablet {
    .text {
      width: 80%;
      margin: 0 30px;
    }
    .img-block {
      width: 80%;
      &::after {
        height: 110%;
        top: -6%;
      }
    }
  }
  @media only screen and (max-width: 400px) {
    flex-direction: column;
    .text {
      margin: 0 0 50px 0;
    }
    .img-block {
      &::after {
        bottom: -3%;
        top: unset;
        height: 44%;
        width: 67%;
      }
    }
  }
}

